import React from 'react';
import { List, Switch } from 'antd-mobile';

import 'antd-mobile/dist/antd-mobile.css';

class SwitchExample extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: false,

        };
    }

    render() {

        return (
            <Switch
                checked={this.state.checked}
                onChange={() => {
                    this.setState({
                        checked: !this.state.checked,
                    });
                }}
            />
        );
    }
}



export default SwitchExample
